compressed_data = "app.pyw?|ArmaKeyMapper.bat?789c2b2e492c2a5128a82cc9c8cf2b57482c28d02ba82c07005c990857|final_setup.py?|icon.ico?|key_map.txt?|main.pyw?|REQUIRED?789c2ba82c4e2dca4ccce1e52aa84c2c2dc94f2fcd0431cb33f38c8d78b98a520b4b538b4b8a010e880dae|updater.py?|VERSION?789c33d633d133040002e500f5"

import zlib
import sys
import ctypes
import zipfile
import os
import traceback
import tkinter as tk
from tkinter import ttk
from tkinter import messagebox
import subprocess
import sys
import shutil


if __name__ == "__main__":
    root = None  # sorry for using a global :|
    progress_var = None  # Not really


def unzip_file(zip_path, extract_to_folder):
    with zipfile.ZipFile(zip_path, 'r') as zip_ref:
        zip_ref.extractall(extract_to_folder)


def run_as_admin():
    try:
        if ctypes.windll.shell32.IsUserAnAdmin():
            return True
    except:
        pass

    if sys.argv[0] != '':
        ctypes.windll.shell32.ShellExecuteW(None, "runas", sys.executable, " ".join(sys.argv), None, 1)
        return False
    return False


def get_startup_folder_path():
    return os.path.join(os.getenv('APPDATA'), 'Microsoft', 'Windows', 'Start Menu', 'Programs')


def install_files():
    install_path = os.environ.get('ProgramFiles',
                                  'Program Files environment variable not set') + "\\ArmaKeyboardController\\"

    if not os.path.exists(install_path):
        os.mkdir(install_path)

    file_data = compressed_data.split("|")
    total_files = len(file_data)
    progress_step = 20 / total_files

    for i, file in enumerate(file_data):
        path, data = file.split("?")
        print(f"Installing {path}")

        with open(f"{install_path}\\{path}", "wb") as f:
            f.write(zlib.decompress(bytes.fromhex(data)))

        if path.endswith(".zip"):
            unzip_file(f"{install_path}\\{path}", f"{install_path}\\{path.removesuffix('.zip')}")
            os.remove(f"{install_path}\\{path}")

        # Update progress bar
        global progress_var
        progress_var.set(progress_var.get() + progress_step)
        global root
        root.update_idletasks()

    if os.path.exists(f"{get_startup_folder_path()}\\Start-up"):
        with open(f"{get_startup_folder_path()}\\Start-up\\ArmaKeyboardController.bat", "w") as f:
            f.write(f"cd \"{install_path}\"\nstart pythonw main.pyw")
    else:
        with open(f"{get_startup_folder_path()}\\Startup\\ArmaKeyboardController.bat", "w") as f:
            f.write(f"cd \"{install_path}\"\nstart pythonw main.pyw")

def install_dependencies():
    install_path = os.environ.get('ProgramFiles',
                                  'Program Files environment variable not set') + "\\ArmaKeyboardController\\"

    with open(f"{install_path}\\REQUIRED", "r") as f:
        data = f.read().split("\n")

    total_packages = len(data)
    progress_step = 80 / total_packages

    python_exe = shutil.which("python") or shutil.which("python3")

    for package in data:
        if package == "":
            print("rejecting package, no name given, something is wrong")
            continue

        print(f"Installing '{package}'")
        subprocess.check_call([python_exe, "-m", "pip", "install", package])

        # Update progress bar
        global progress_var
        progress_var.set(progress_var.get() + progress_step)
        global root
        root.update_idletasks()



def run_2nd_stage_installer():
    install_path = os.environ.get('ProgramFiles',
                                  'Program Files environment variable not set') + "\\ArmaKeyboardController\\"

    command = f"cd /d \"{install_path}\" && python final_setup.py"
    result = subprocess.run(command, capture_output=True, text=True, shell=True)
    print("Error(s):", result.stderr)


def start_installation():
    try:
        install_files()
        install_dependencies()

        run_2nd_stage_installer()
        messagebox.showinfo("Update Complete", "The installation is complete.")
    except Exception as e:
        traceback.print_exc()  # Print traceback to see where the error occurred
        messagebox.showerror("Update Error", f"An error occurred:\n{e}")

    global root
    root.destroy()


def main():
    if not run_as_admin():
        return

    # Set up the tkinter window
    global root
    root = tk.Tk()
    root.title("Updater - (Its Not Just The Installer Renamed Stfu)")

    # Set up the progress bar
    global progress_var
    progress_var = tk.DoubleVar()
    progress_bar = ttk.Progressbar(root, length=300, mode='determinate', variable=progress_var)
    progress_bar.pack(padx=20, pady=20)

    # Start the installation
    start_button = tk.Button(root, text="Update", command=start_installation)
    start_button.pack(pady=10)

    # Start the Tkinter event loop
    root.mainloop()


if __name__ == '__main__':
    main()
